import React, { Component, Fragment } from 'react';
import "./index.css";
import Canvas from './components/graficEditor/GraficEditor';

import styles from './components/graficEditor/gallery/Gallery.module.css';
//import Palette from './components/Palette/Palette'
//import DrawToolBar from './components/DrawToolBar'

class App extends Component{
  constructor(props){
    super(props);
    this.state = {
      value: 10
    }

  }

  render(){
    return <div id='grid'> 
      <header className={styles.header}>PaintYourFace</header>
      <div className={styles.camera}>
        <div>Camera</div>
      <video muted className={styles.webcam} className="visible"></video>
      <div className={styles.background}>
      <svg width="100%" height="100%">
        <rect x="0" y="0" width="100%" height="100%" stroke="none" fill="url(#pattern-image)" />
      </svg>
	  </div>
      <canvas id="faceCanvas" tabIndex="1"></canvas>
    </div>
      <Canvas  style ={{width: '450px', height: '450px', border:'2px solid red'}}/> 
    </div>
  };
}



export default App;
